webpackJsonp([0x8bbbc50171d6],{9031:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"BlogMap",date:"30 May 2002",slug:"/2002-05-30-blogmap/",tags:"Y2002"},html:'<p><a href="http://www.blogworld.de">BlogHaus</a> \'Deutsche Weblog Community\' now features a <a href="http://www.blogworld.de/karte.php">Blogger Karte</a>. a map of bloggers in German-speaking countries. The blogs themselves don\'t seem to need to be in German, since they let <i>me</i> in.</p>'},next:{fields:{title:"Free Democrats Trip Over Far-Right Foot",date:"28 May 2002",slug:"/2002-05-28-free-democrats-trip-over-far-right-foot/"}},previous:{fields:{title:"Layoffs Update 2",date:"30 May 2002",slug:"/2002-05-30-layoffs-update-2/"}}},{node:{fields:{title:"Free Democrats Trip Over Far-Right Foot",date:"28 May 2002",slug:"/2002-05-28-free-democrats-trip-over-far-right-foot/",tags:"Y2002"},html:'<p>JTA: <a href="http://www.jta.org/page_view_story.asp?intarticleid=11353&amp;intcategoryid=2">Large German party in turmoil over accusations of anti-Semitism</a>. Or for the Free Democrats, with a party vice-chair like Jürgen Möllemann, who needs enemies? Is his flirt with anti-Semetism just stupid, or is he trying to sabotage party chair and chancellor candidate Westerwelle? But now, according to <a href="http://www.focus.de/G/GN/gn.htm?snr=106128&amp;streamsnr=7&amp;q=1">Focus</a>, he says he is sorry. Maybe he should stick to his hobby of skydiving.</p>'},next:{fields:{title:"PHP blo.gs blogroll",date:"27 May 2002",slug:"/2002-05-27-php-blogs-blogroll/"}},previous:{fields:{title:"BlogMap",date:"30 May 2002",slug:"/2002-05-30-blogmap/"}}},{node:{fields:{title:"PHP blo.gs blogroll",date:"27 May 2002",slug:"/2002-05-27-php-blogs-blogroll/",tags:"Y2002"},html:'<p>I\'ve always liked the  <a href="http://www.dansanderson.com/blogtracker/spane.php?open=1">Sidebar Panel</a> from <a href="http://www.dansanderson.com/blogtracker">Blogtracker</a>, and wished I could somehow include it here.  Now I\'ve discovered <a href="http://blo.gs">blo.gs</a>, a service similar to blogtracker, and my dream has come true, since blo.gs can export a favorites list as XML. Thanks to the <a href="http://philringnalda.com/phpblogroll/">PHP blo.gs blogroll</a> at philringnalda.com, my favorite list with update times gets pulled once an hour for your (but mostly my) viewing pleasure. </p>\n<p><b>Update</b>:  I\'ve now<a href="http://www.papascott.de/examples/blogroll-ps.phps"> posted </a>my version of the script.</p>'},next:{fields:{title:"PapaScott Hacked",date:"27 May 2002",slug:"/2002-05-27-papascott-hacked/"}},previous:{fields:{title:"Free Democrats Trip Over Far-Right Foot",date:"28 May 2002",slug:"/2002-05-28-free-democrats-trip-over-far-right-foot/"}}}],pathPrefix:"",first:!1,last:!1,index:892,pageCount:1101}}}});
